    false,nt"url": null,nt"notes": "This is the 1993 annual narrative report
    for Neal Smith National Wildlife Refuge (formerly Walnut Creek National Wildlife
    Refuge).  The report begins by covering the yearu2019s highlights and climatic conditions.
     Land acquisition is discussed next, followed by refuge planning- the Master Plan,
    the Management Plan, public participation, compliance with environmental and cultural
    mandates, and research/investigations are outlined in this section.  Administration
    is covered in the following section; lists of personnel and volunteer programs are
    given as well as information about refuge funding.  Information about habitat management
    is provided.  Topics include croplands, grasslands, savanna, haying, grazing, pest
    control, reconstruction, harvest, and fire management.  Refuge wildlife is also
    discussed; a list of migratory birds spotted on the refuge is provided.  General
    public uses of the refuge are described as well as education and hunting.  A list
    of construction/maintenance projects and new refuge equipment is given.  Finally,
    cooperative programs are discussed.",nt"license_title": "License Not Specified",nt"extras":
